pragma solidity ^0.5.0;

contract PetIdValidation {
    mapping(uint => bool) private validPetId;

    constructor() public {
        validPetId[0] = true;
        validPetId[1] = true;
        validPetId[2] = true;
        validPetId[3] = true;
        validPetId[4] = true;
        validPetId[5] = true;
        validPetId[6] = true;
        validPetId[7] = true;
        validPetId[8] = true;
        validPetId[9] = true;
        validPetId[10] = true;
        validPetId[11] = true;
        validPetId[12] = true;
        validPetId[13] = true;
        validPetId[14] = true;
    }

    function validatePetId(uint petId) public view returns(bool) {
        return validPetId[petId];
    }
}
